function Navbar () {
    return(
        <nav className='container'>
            <div classname="two/thirds column">
                <a className="one column" href="/">Home</a>
                <a className="one column" href="/">About</a>
            </div>
            <a className="one/third column" href="/">Login</a>
        </nav>
    )
}

export default Navbar;
